import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (nav-menu)
    await page.waitForSelector('.nav-menu', { timeout: 5000 });

    // Click the mobile menu trigger to open the menu
    await page.click('.nav-menu');

    // Wait for the mobile menu overlay to appear
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Take screenshot of mobile menu open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Wait for a visible menu link (e.g., "Electronics" in mobile menu)
    // Use XPath to ensure we get the correct "Electronics" link inside the overlay
    const electronicsLinkXPath = "//div[contains(@class,'mobile-menu')]//a[contains(.,'Electronics')]";
    await page.waitForSelector(`xpath=${electronicsLinkXPath}`, { timeout: 5000 });

    // Click the "Electronics" link in the mobile menu
    const [electronicsLink] = await page.$x(electronicsLinkXPath);
    if (electronicsLink) {
      await electronicsLink.click();
    }

    // Take screenshot after clicking the menu link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_clicked.png'));

    // Close the mobile menu by clicking the close button
    // Wait for the close button inside the overlay
    await page.waitForSelector('#mobileMenuOverlay.show .close-mobile-menu', { timeout: 5000 });
    await page.click('#mobileMenuOverlay.show .close-mobile-menu');

    // Wait for the overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 5000 });

    // Take screenshot after closing mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    // Extract data: check if the main content updated to Electronics category
    // We'll look for a heading or category card with "Electronics"
    let electronicsCategoryVisible = false;
    try {
      // Try to find a heading or card with "Electronics"
      const electronicsHeader = await page.$('text=Electronics');
      electronicsCategoryVisible = !!electronicsHeader;
    } catch (e) {
      electronicsCategoryVisible = false;
    }

    return {
      success: true,
      action: "Tested mobile menu navigation: opened menu, clicked 'Electronics', closed menu, and verified navigation.",
      extractedData: {
        electronicsCategoryVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
